import base64
import gzip
from io import BytesIO
import json

# The base64 encoded and gzip compressed data
encoded_data = ""

# Decode the base64 string
decoded_data = base64.b64decode(encoded_data)

# Decompress the gzip data
compressed_stream = BytesIO(decoded_data)
gzip_file = gzip.GzipFile(fileobj=compressed_stream)
decompressed_data = gzip_file.read()

# Convert bytes to string
readable_data = decompressed_data.decode('utf-8')

print(json.dumps(readable_data, indent=4))
